// React-specific
import React from 'react' ;
import ReactDOM from 'react-dom/client' ;
import SiteLayout from './common/SiteLayout' ;

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
) ;

root.render(
    <React.StrictMode>
        <SiteLayout />
    </React.StrictMode>
) ;
